import React, { useState } from "react";
import AnchorLink from "react-anchor-link-smooth-scroll";
import "./navbar.scss";
export const Navbar = () => {
  const [clicked, setClickedItem] = useState({
    home: true,
    exp: false,
    skills: false,
    contact: false,
  });
  return (
    <div className="navbar">
      <AnchorLink className="navbar--item" href="#home">
        Home
      </AnchorLink>
      <AnchorLink className="navbar--item" href="#experience">
        Experience
      </AnchorLink>
      <AnchorLink className="navbar--item" href="#skills">
        Skills
      </AnchorLink>
      <AnchorLink className="navbar--item" href="#contact">
        Contact
      </AnchorLink>
    </div>
  );
};
